def predict(triples: list[Triple]) -> str:
    clauses = []

    for triple in triples:
        if triple.predicate == "cityServed":
            clauses.append(f"{triple.subject} serves {triple.object}")
        elif triple.predicate == "country":
            clauses.append(f"{triple.subject} is in {triple.object}")
        elif triple.predicate == "capital":
            clauses.append(f"The capital of {triple.subject} is {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevel":
            clauses.append(f"{triple.subject} has an elevation of {triple.object} meters")
        elif triple.predicate == "location":
            clauses.append(f"{triple.subject} is located in {triple.object}")
        elif triple.predicate == "operatingOrganisation":
            clauses.append(f"{triple.subject} is operated by {triple.object}")
        elif triple.predicate == "runwayLength":
            clauses.append(f"The runway length of {triple.subject} is {triple.object} meters")
        elif triple.predicate == "runwayName":
            clauses.append(f"The runway name of {triple.subject} is {triple.object}")
        elif triple.predicate == "1stRunwayLengthFeet":
            clauses.append(f"{triple.subject} has a first runway length of {triple.object} feet")
        elif triple.predicate == "1stRunwaySurfaceType":
            clauses.append(f"The first runway surface of {triple.subject} is {triple.object}")
        elif triple.predicate == "icaoLocationIdentifier":
            clauses.append(f"The ICAO identifier of {triple.subject} is {triple.object}")
        elif triple.predicate == "iataLocationIdentifier":
            clauses.append(f"The IATA identifier of {triple.subject} is {triple.object}")
        elif triple.predicate == "nativeName":
            clauses.append(f"{triple.subject} is also known as {triple.object}")
        else:
            clauses.append(f"{triple.subject} {triple.predicate} {triple.object}")

    sentence = ""
    airport = None
    location_info = []

    for clause in clauses:
        if airport is None:
            airport = clause.split(" ")[0]  # Extract airport name
            sentence += clause + " "
        elif "is in" in clause:
            sentence += f"which is in {clause.split('is in ')[1]} "
        elif "is located in" in clause:
            sentence += f"which is located in {clause.split('is located in ')[1]} "
        elif "has an elevation of" in clause:
            sentence += f"and has an elevation of {clause.split('has an elevation of ')[1]} "
        else:
            sentence += f"and {clause} "

    if sentence:
        sentence += "."

    return sentence

